from typing import List
from collections import Counter
class Solution:
    def canConvertString(self, s: str, t: str, k: int) -> bool:
        if len(s) != len(t): return False
        thealap = 'abcdefghijklmnopqrstuvwxyz'
        dt = {}
        for i,v in enumerate(thealap):
            dt[v] = i+1
        lianbiao = [[] for i in range(len(s))]
        sst = set([])
        for i in range(len(s)):
            if s[i] != t[i]:
                jieguo = dt[t[i]] - dt[s[i]]
                if jieguo<0 : jieguo+=26
                lianbiao[i].append(jieguo)
                sst.add(jieguo)

        setdt = {}

        for i in lianbiao:
            if i:
                for j in i:
                    tmpp = j
                    if tmpp in setdt:
                        setdt[j] = setdt[j]+26
                    else:
                        setdt[j] = j

                    if setdt[j]>k:return False

        return True



solu = Solution()
print(solu.canConvertString(""
,""
,615804))